const Form = () => {
    return(
        <div style={ { color: "green" } }>

        <form>
            <label>gmail</label>
            <input>Gmail</input>

            <label>username</label>
            <input>Username</input>

            <label>password</label>
            <input>Password</input>
        </form>
        </div>
    )
}

export default Form;
